
import { chai, expect } from 'meteor/practicalmeteor:chai';

import React from 'react';
import ReactDOM from 'react-dom';
import TestUtils from 'react-addons-test-utils';
import ImageList from './ImageList.jsx';
import {Image} from './ImageList.jsx';


var image = {
	"_id" : "b6jkv2qjdRHeyEZ5d",
	"pictureData" : "data:image/jpeg;base64,",
	"emoji" : "😊",
	"createdAt" : new Date("2016-04-27T16:17:36.607Z"),
	"owner" : "ywA7oTpg9DwRyLpan",
	"usersBet" : [ ],
	"options" : [
		"😊",
		"😪",
		"😭",
		"😂"
	],
	"expired" : false
}

describe('Image Component', () => {
	const imageComp = TestUtils.renderIntoDocument(
		<Image key={image._id} picture={image} alreadyBet={false} />
	);
	const picture = imageComp.props.picture
	it('should have an id', () => {
		expect(picture._id).to.not.be.an('undefined');
		expect(picture._id.length).to.not.equal(0);
	})
	it('should have 4 options', () => {
		expect(picture.options.length).to.equal(4)
	});
	it('should have an owner', () => {
		expect(picture.owner).to.not.be.an('undefined');
		expect(picture.owner.length).to.not.equal(0);
	})
	it('should have a correct emoji', () => {
		expect(picture.emoji).to.not.be.an('undefined');
		expect(picture.emoji.length).to.not.equal(0);
	})
});

describe('ImageList Component', () => {
	const images = [image];
	const imageListComp = TestUtils.renderIntoDocument(
		<ImageList images={images} />
	);
	it('should have atleast one image', () => {
		expect(imageListComp.props.images).to.not.be.an('undefined');
		expect(imageListComp.props.images.length).to.not.equal(0);
	})
})
